import './BoxScoreItem.css'

function BoxScoreItem() {
  return (
    <div className="boxscore-item">
      <div>March 28th 2021</div>
      <div>Opponent: Timberwolves</div>
      <div></div>

      <div className='boxscore-item__description'>
        <h2>Miami Heat</h2>
        <h2>Jimmy Butler</h2>
        <div className='boxscore-item__stats'>29 Points</div>
        <div className='boxscore-item__stats'>9 Rebounds</div>

      </div>
    </div>
  );
}

export default BoxScoreItem;
